package com.programming.leetcode.Medium;

import java.util.*;

public class SortCharacterFrequency {

    public String frequencySort(String s) {

        Map<Character, Integer> charFrequency = new HashMap<>();
        for(char c : s.toCharArray()){
            charFrequency.put(c , charFrequency.getOrDefault(c, 0)+1);
        }

        Map<Character, Integer> sortedByValue = new TreeMap<>( (k1, k2) -> charFrequency.get(k1) >= charFrequency.get(k2) ? -1 : 1 );

        //Map<Character, Integer> sortedByValue = new TreeMap<>( (k1, k2) ->  charFrequency.get(k2) - charFrequency.get(k1));
        sortedByValue.putAll(charFrequency);
        StringBuilder strBld = new StringBuilder();
        for(Map.Entry<Character,Integer> entry : sortedByValue.entrySet()){
            for(int i = 0; i < (int)entry.getValue() ; i++){
                strBld.append(entry.getKey());
            }
        }
        return strBld.toString();
    }

    public String frequencySortUsingPriorityQueue(String s) {
        Map<Character, Integer> map = new HashMap<>();
        for (char c : s.toCharArray())
            map.put(c, map.getOrDefault(c, 0) + 1);

        PriorityQueue<Map.Entry<Character, Integer>> pq = new PriorityQueue<>((a, b) -> b.getValue() - a.getValue());
        pq.addAll(map.entrySet());

        StringBuilder sb = new StringBuilder();
        while (!pq.isEmpty()) {
            Map.Entry e = pq.poll();
            for (int i = 0; i < (int) e.getValue(); i++)
                sb.append(e.getKey());
        }
        return sb.toString();
    }

    public static void main(String[] args) {
        SortCharacterFrequency obj = new SortCharacterFrequency();
        System.out.println(obj.frequencySort("Aabb"));
        System.out.println(obj.frequencySort("tree"));
        System.out.println(obj.frequencySort("cccaaa"));
        System.out.println(obj.frequencySort(""));
        System.out.println(obj.frequencySortUsingPriorityQueue(""));
    }

}
